import React from "react";
import { reduxForm, Field } from "redux-form";
import { Input, Form } from "antd";

class LoginForm extends React.Component() {
  render() {
    console.log("govno");

    return (
      <Form>
        <div>
          <label> Name </label>
          <Field name="firstName" component={Input} />
        </div>
      </Form>
    );
  }
}

LoginForm = reduxForm({
  form: "login"
})(LoginForm);

export default LoginForm;
